import "../../css/curatedbrands.css";
import data from "../../Data/CuratedBrands/data";

function MainDetailCurated(props) {
  return (
    <>
      {/* 3D */}
      <div className="max-w-6xl mt-40 text-center mx-auto px-4 sm:px-6 ">
        <span className="font-Lobster text-5xl font-semibold">
          Spinin Records
        </span>
      </div>
      <div className="max-w-6xl mt-10 text-center   mx-auto px-4 sm:px-6">
        {data.map((d, key) => {
          return (
            <a href="#">
              <Carousel className="mt-20 shadow-2xl">
                <Carousel.Item className="changeColor">
                  <div>
                    <img
                      src={d.src}
                      class="object-cover  w-full ..."
                      style={{ height: 430 }}
                    />
                  </div>

                  <Carousel.Caption style={{ paddingBottom: 90 }}>
                    <div className="row">
                      <div className="col-md-3"></div>
                      <div className="col-md-6 transparent">
                        <div style={{ paddingTop: 50, paddingBottom: 50 }}>
                          <h1>First slide label</h1>
                          <p>
                            Lorem ipsum dolor sit amet, consectetur adipiscing
                            elit.
                          </p>
                        </div>
                      </div>
                    </div>
                  </Carousel.Caption>
                </Carousel.Item>
              </Carousel>
            </a>
          );
        })}
      </div>
    </>
  );
}
export default MainDetailCurated;
